#include<string>
#include<iostream>
#include <algorithm>
#include <unordered_map>
#include <vector>

using namespace std;


class Solution {
public:
    bool isIsomorphic(string s, string t) {
        // create a map from s to t
        unordered_map<char, int> map1, map2;
        int szS = s.size(), szT = t.size();
        if(szS != szT) return false;
        for(int i=0; i<szS; i++)
        {
            if(map1[s[i]] != map2[t[i]]) return false;
            map1[s[i]] = i+1;
            map2[t[i]] = i+1;
        }
        return true;
    }

};

